import React from 'react';
import Header from './Header';
import Footer from './Footer';

const SubjectPage = ({ selectedSubject }) => {
  return (
    <div>
      <Header />
      <div>
        <h1>Subject: {selectedSubject}</h1>
        {/* Add subject content here */}
      </div>
      <Footer />
    </div>
  );
};

export default SubjectPage;
